import{_ as a}from"./chunks/index.VAya1KE4.js";import{c,o as e,G as o,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const l=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":"丽娜","idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":316,"name":"丽娜","summary":"亚历山德丽娜·莎芭丝缇安","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/29/141353238/9a978a559ee6822481b7d4143170affe_464856154643405893.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/86d6005967954d12f8828db295e3eb42_5621778155081973278.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/10/76099754/c47f14bacdce20754f3cd42a6e7acb87_4956173882472889807.png"},"attrs":[["稀有度","S"],["属性","电"],["特性","支援"],["阵营","维多利亚家政"]],"destiny":[["LEVEL1双人领舞","被指派并发动攻击后，返回丽娜身边前，杜苏拉和安娜塔莎会在原处额外逗留5.5秒；在杜苏拉或安娜塔莎附近10米范围内的角色，从[核心被动: 迷你毁灭拍档]中获得的增益效果提升至原本的130%。「干不完活就要挨揍!」杜苏拉总是这样鼓励大家。「挨揍挨揍!」安娜塔莎总是如此附和。"],["LEVEL2主人的典范","进入接战状态或换入前场时，丽娜造成的伤害提升15%，持续12秒，18秒内最多触发一次。「只有卓越的女仆长能够带领卓越的女仆，只有模范的主人能够培养模范的邦布。」——丽娜在「维多利亚家政人力资源管理暨邦布培养心得分享讲座」上的讲话"],["LEVEL3女仆长的专长","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2丽娜总是有做好任何事的自信和毁灭任何事的本领。不过，在毁灭敌人的好心情这件事上，她的信心和能力得到了统一。"],["LEVEL4针与锤","杜苏拉和安娜塔莎均被指派在外时，丽娜的能量自动回复速度提升0.5点/秒；杜苏拉或安娜塔莎返回丽娜身边时，对应增益效果结束。杜苏拉和安娜塔莎从未达成任何一致的意见，「殴打前面那个傻瓜」是一个例外。"],["LEVEL5完美主义女仆长","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技]技能等级+2「『丽娜』在邦布的语言里是完美的意思。」完美主义是维多利亚家政员工手册的第一准则。面对于「完美」的评判，丽娜自有准绳。"],["LEVEL6雷雨夜惊魂","[强化特殊技]、[连携技]或[终结技]命中敌人时，全队造成的电属性伤害提升15%，持续8秒。雨夜的古堡，雷声隆隆。长廊的深处，诡影憧憧。恐惧电路超载，惊悚电影开拍。"]],"skill":[{"title":"普通攻击：痛打呆子","desc":"点按发动：指派杜苏拉和安娜塔莎发动至多四段的攻击，造成物理伤害和电属性伤害；在杜苏拉和安娜塔莎攻击期间，丽娜执行其他行动，不会打断[普通攻击]的连击段数。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/04/82232455/caa233994cc270a332b6dcb2b9513bbe_5171913586410570442.gif"},{"title":"普通攻击：赶走傻瓜","desc":"长按或发动：召回杜苏拉和安娜塔莎，在身边回旋后进行范围攻击，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/e44828f8b98d6d171c315f6fd3062ebe_2928055217180520758.gif"},{"title":"闪避：抚平裙摆","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/25/160824341/db566dc5181aa666c3e5769a4a990b0a_4010878789330743543.gif"},{"title":"冲刺攻击：突然惊吓","desc":"闪避时，点按发动：指派杜苏拉和安娜塔莎发动穿透攻击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/42f6672cecfcf4560daf34653d2b99f8_1494262677812174210.gif"},{"title":"闪避反击：邦布回魂","desc":"触发[极限闪避]后，点按发动：指派杜苏拉和安娜塔莎，向前方旋转飞出井触发爆炸，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/38be4bde74b1409d9560116c2af939f7_9002803507369695486.gif"},{"title":"快速支援：二拍的阿勒芒德","desc":"当前操作中的角色被击飞时，点按发动：指派杜苏拉和安娜塔莎，向前方旋转飞出并触发爆炸，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/05/29/141353238/f23d6f0851122131214234258d7d0cc1_5217052154805110860.gif"},{"title":"回避支援：三拍的库朗特","desc":"前场角色即将被攻击时，点按发动：回避敌人的攻击，并触发[极限视域]；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/06160bc305575c15d7e3ba9b806a3817_248265254635081971.gif"},{"title":"支援突击：四拍的加沃特","desc":"发动[回避支援]后，点按发动：指派杜苏拉和安娜塔莎，向前方持续推进并生成涡旋电场，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2025/01/09/76099754/a3a7e6858c34ed14836d27629dfbef3e_4797296815311547266.gif"},{"title":"特殊技：砸扁笨蛋","desc":"点按发动：指派安娜塔莎发动下砸攻击，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/94be468c01bfd92481d278fe839310dc_400868005304413563.gif"},{"title":"强化特殊技：笨蛋消失魔法","desc":"能量足够时，点按发动：指派杜苏拉和安娜塔莎发动持续下砸攻击，造成大量电属性伤害；招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/b8cad7776721491c5c013600145b6efd_5366025506462577260.gif"},{"title":"连携技：侍者守则","desc":"触发[连携技]时，选择对应角色发动：指派杜苏拉和安娜塔莎，向前方持续推进并生成球形电场，造成大量电属性伤害；杜苏拉和安娜塔莎在推进期间无法响应[普通攻击]、[冲刺攻击]、[特殊技]或[强化特殊技]的指令，但可以通过发动[普通攻击：赶走傻瓜]将其召回丽娜身边；招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/093d87a056b89b4a1f7abdb68da3ecbc_6104280464827258406.gif"},{"title":"终结技：女王的侍从们","desc":"喧响等级达到[极]时，点按发动：指派杜苏拉和安娜塔莎，向前方持续推进并发动高速回旋，造成大量电属性伤害；杜苏拉和安娜塔莎在推进期间无法响应[普通攻击]、[冲刺攻击]、[特殊技]或[强化特殊技]的指令，但可以通过发动[普通攻击：赶走傻瓜]将其召回丽娜身边；招式发动时，队伍中其他角色回复10点能量，下一名换入前场的角色额外回复20点能量；招式发动期间拥有无敌效果；招式命中敌人时，将触发[快速支援]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/24/160824341/6dadeeeb813df185bcac8cde8e3e4681_2086980591791697091.gif"},{"title":"核心技","desc":"核心被动：迷你毁灭拍档指派杜苏拉或安娜塔莎进行攻击时，队伍中其他角色的穿透率随丽娜自身的穿透率提升，提升效果等同于丽娜自身穿透率的25%+6%，最高不超过30%，杜苏拉和安娜塔莎均返回丽娜身边后，对应增益效果结束。（此处数据为初始数据）额外能力：完美舞会队伍中存在与自身属性或阵营相同的角色时触发：队伍中任意角色对敌人施加[感电]效果时，持续时间提升3秒；场上存在处于[感电]状态下的敌人时，全队造成的电属性伤害提升10%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/02/141353238/ada75b7ac63704a7f8ea7e174ec0bda7_7572484976952043548.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/丽娜.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/丽娜.md"},_=Object.assign(d,{setup(i){return(p,n)=>(e(),c("div",null,[o(t(a))]))}});export{l as __pageData,_ as default};
